   MO.SOrthoMatrix3d_perspectiveLH = function SOrthoMatrix3d_perspectiveLH(pw, ph, pn, pf){
      var d = this._data;
      d[ 0] = 2.0 * pn / pw;
      d[ 1] = 0.0;
      d[ 2] = 0.0;
      d[ 3] = 0.0;
      d[ 4] = 0.0;
      d[ 5] = 2.0 * pn / ph;
      d[ 6] = 0.0;
      d[ 7] = 0.0;
      d[ 8] = 0.0;
      d[ 9] = 0.0;
      d[10] = pf / (pf - pn);
      d[11] = 1.0;
      d[12] = 0.0;
      d[13] = 0.0;
      d[14] = (pn * pf) / (pn - pf);
      d[15] = 0.0;
   }
