      o._defines       = null;
      o.lsnsLoaded     = null;
      o.construct      = FUiDescribeFrameConsole_construct;
      o.load           = FUiDescribeFrameConsole_load;
      o.events         = null;
      o.formId         = 0;
      o.createFromName = FUiDescribeFrameConsole_createFromName;
      o.loadNode       = FUiDescribeFrameConsole_loadNode;
