      o.nextFormId     = FUiDescribeFrameConsole_nextFormId;
      o.get            = FUiDescribeFrameConsole_get;
      o.find           = FUiDescribeFrameConsole_find;
      o.getLov         = FUiDescribeFrameConsole_getLov;
      o.findLov        = FUiDescribeFrameConsole_findLov;
