      var o = this;
      var htb = RBuilder.appendTable(b.hPanel);
       htb.style.tableLayout = 'fixed';
       var hr = o.hEdit = htb.insertRow();
      o.onBuildChange(hr.insertCell())
      var hc = hr.insertCell();
