   MO.FUiCalendarEditor_onTimeBlur = function FUiCalendarEditor_onTimeBlur(e){
      var o = this;
       var h = e.hSource;
       if(h == o.hHour){
          h.value = Math.min(RInteger.parse(h.value), 23);
       }else if(h == o.hMinute){
          h.value = Math.min(RInteger.parse(h.value), 59);
       }else if(h == o.hSecond){
          h.value = Math.min(RInteger.parse(h.value), 59);
       }
       o.storeChange();
       o.setDate(o.date);
   }
