      o.construct     = FUiSelectEditor_construct;
      o.testBlur      = FUiSelectEditor_testBlur;
      o.buildItems    = FUiSelectEditor_buildItems;
      o.clearItems    = FUiSelectEditor_clearItems;
      o.get           = FUiSelectEditor_get;
