      var space = o._activeSpace;
      if(!space){
         return;
      }
      var bitmap = o._activeBitmap;
      if(!bitmap){
         return;
      }
      o._capturePosition.set(event.clientX, event.clientY);
      o._captureMatrix.assign(bitmap.matrix());
      RHtml.cursorSet(o._hPanel, EUiCursor.Pointer);
