      c._workspace = o;
      c.build(p);
      c.addSelectedListener(o, o.onCatalogSelected);
      o._frameCatalog.push(c);
      var f = o._canvasToolbarFrame = o.searchControl('canvasToolbarFrame');
      var c = o._canvasToolbar = RClass.create(FDsSceneCanvasToolBar);
      c._workspace = o;
